def δ (x : ℕ) : ℕ :=
  if h : 0 < x then
    let divisors := {d ∈ Finset.range (x + 1) | d ∣ x ∧ d % 2 = 1}
    divisors.max' (Finset.nonempty_of_mem (Finset.mem_filter.2 ⟨Finset.mem_range.2 (Nat.lt_succ_self x), Nat.one_dvd x, Nat.mod_one_eq_zero⟩))
  else 1

def δ (x : ℕ) : ℕ :=
  if h : x = 0 then 1 else
    Nat.find_greatest (λ d, d ∣ x ∧ d % 2 = 1) x
